select  distinct
	TRIM(SISYR) SMOD_CODE,
  	COALESCE(LIBELLE,TRIM(SISYR))  SMOD_NAME
FROM <%=odiRef.getModel("SCHEMA_NAME")%>.F9801
inner join QSYS2.SYSTABLES on (TABLE_SCHEMA ='<%=odiRef.getModel("SCHEMA_NAME")%>'  and TRIM(SIMID) = TABLE_NAME)
left outer join (select F0005.DRKY SYSCODE,F0005.DRKY||' - '||COALESCE(F0005D.DRDL01,F0005.DRDL01) LIBELLE ,F0005.DRDL01
	from <%=odiRef.getModel("SCHEMA_NAME")%>.F0005 F0005
	left outer join <%=odiRef.getModel("SCHEMA_NAME")%>.F0005D  F0005D on (TRIM(F0005D.DRRT) = 'SY' and trim(F0005D.DRSY) = 'H90' and TRIM(DRLNGP) = '<%=odiRef.getOption("JDE_LANGUAGE")%>'  and F0005.DRKY = F0005D.DRKY)
	where TRIM(F0005.DRRT) = 'SY' and trim(F0005.DRSY) = 'H90' ) LIB on ( trim(SYSCODE) = trim(SISYR) )
where 
	TRIM(SIMID) like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 	
<% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( " and TRIM(SISYR) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( " and TRIM(SISYR) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>

