	TRIM(SIMID)					RES_NAME,
	SIPFX||SUBSTR(SIMID,4)				TABLE_ALIAS,
	TRIM(SIMD)					TABLE_DESC,
	TRIM(SISYR)||'(T)' 		SMOD_CODE,
	1  					R_COUNT
