select	TRIM(tab.SIMD)||'_'||col.TABLE_NAME	TABLE_NAME,
	col.COLUMN_NAME		COL_NAME,
        	SUBSTR(trim(COALESCE (LNGSPEC.FRDSCR,LNGDEF.FRDSCR)),1,35)  	COL_HEADING,
        	trim(COALESCE(LNGSPEC.FRDSCR,LNGDEF.FRDSCR))      		COL_DESC,
 	col.ORDINAL_POSITION 		POS,
	case Strip(col.DATA_TYPE)
		when 	'TIMESTMP' 
		then 	'TIMESTAMP' 
		else 	Strip(col.DATA_TYPE) 
	 end			DT_DRIVER,
	col.LENGTH      		LONGC,
	col.NUMERIC_SCALE		SCALEC,
	case col.IS_NULLABLE
	      when 	'Y' then  '0'
	      else	 '1'
	      end			COL_MANDATORY
from	QSYS2.SYSCOLUMNS 	col
left outer join <%=odiRef.getModel("SCHEMA_NAME")%>.F9202 LNGDEF   on (substr(col.column_name,3) =LNGDEF.frdtai and  LNGDEF.FRLNGP =' ' and LNGDEF.FRSYR = ' ') 
left outer join <%=odiRef.getModel("SCHEMA_NAME")%>.F9202  LNGSPEC  on (substr(col.column_name,3)=LNGSPEC.frdtai and  TRIM(LNGSPEC.FRLNGP) ='<%=odiRef.getOption("JDE_LANGUAGE")%>' and LNGSPEC.FRSYR = ' ' ) 
INNER JOIN <%=odiRef.getModel("SCHEMA_NAME")%>.F9801 tab ON (tab.SIMID = col.TABLE_NAME and SIFUNU NOT IN ( '231', '232') 
AND SISY <> '88'                
AND SIFUNC IN ('PF', 'LF')) 
where	col.TABLE_SCHEMA ='<%=odiRef.getModel("SCHEMA_NAME")%>' and col.TABLE_NAME like '<%=odiRef.getModel("REV_OBJ_PATT")%>'
<% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISYR) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISYR) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
