	TRIM(SIMD)||'_'||TRIM(SIMID)		TABLE_NAME,
	TRIM(a.CONSTRAINT_NAME)		KEY_NAME,
    	TRIM(a.COLUMN_NAME)  		COL_NAME,
	b.ORDINAL_POSITION		POS
FROM 	QSYS2.SYSCSTCOL a
INNER JOIN QSYS2.SYSCOLUMNS b ON (TRIM(a.COLUMN_NAME) = TRIM(b.COLUMN_NAME) and TRIM(a.TABLE_SCHEMA) = TRIM(b.TABLE_SCHEMA) and TRIM(a.TABLE_NAME) = TRIM(b.TABLE_NAME))
INNER JOIN <%=odiRef.getModel("SCHEMA_NAME")%>.F9801 ON (TRIM(SIMID)=TRIM(a.TABLE_NAME)) 
